import styled from 'styled-components'

export const ContainerAboutUs = styled.div`
  display: flex;
  margin-top: 118px;
`

export const ContainerSobre = styled.div`
  display: flex;
  align-items: center;

  h3 {
    font-size: 32px;
    font-weight: bold;
  }

  p {
    font-size: 20px;
    font-weight: regular;
  }

  button {
    background-color: #434142;
    color: white;
    font-size: 20px;

    font-weight: bold;
    padding: 100px 16px 0 0;
  }
`
